			if ($ret) {
				TbalunoImportPeer::doDelete($this, $con);
				$this->postDelete($con);
				// symfony_behaviors behavior
				foreach (sfMixer::getCallables('BaseTbalunoImport:delete:post') as $callable)
				{
				  call_user_func($callable, $this, $con);
